import React from "react";

function Header() {
    return (
        <div>
            <div className="navbar">
                <a href="#" className="active left" > <img src="../src/assets/images/telegram.svg" alt='' height="20" width="20" /> </a> 
                <a href="#" className="left"> Track Locker </a> 
                <a href="#" className="right"> Contact </a> 
                <a href="#" className="right"> Login </a>
            </div>
        </div>
    );
}

export default Header;
